-- For deleting the existing database and to recreate it everytime we run the scripts
DROP DATABASE IF EXISTS FLIPCART;

-- For creating and using the database called FLIPCART
CREATE DATABASE FLIPCART;
USE FLIPCART;

-- For deleting the existing tables and to have no conflicts of foreign keys while deleting tables
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS Customer;
DROP TABLE IF EXISTS Seller;
DROP TABLE IF EXISTS Category;
DROP TABLE IF EXISTS Delivery_Agent;
DROP TABLE IF EXISTS Product;
DROP TABLE IF EXISTS Order_;
DROP TABLE IF EXISTS Payment;
DROP TABLE IF EXISTS Cart;
DROP TABLE IF EXISTS Wishlist;
DROP TABLE IF EXISTS Wallet;
DROP TABLE IF EXISTS Feedback;
DROP TABLE IF EXISTS Updated_Product;
SET FOREIGN_KEY_CHECKS=1;


-- Table creation of each entity --
CREATE TABLE Customer(
customer_id int(10) PRIMARY KEY,
customer_username varchar(50) Not null,
customer_password varchar(50) not null,
DOB date NOT NULL,
customer_number varchar(10) UNIQUE,
customer_number2 varchar(10) UNIQUE,
customer_email_ID varchar(50) UNIQUE,
customer_city varchar(40) NOT NULL,
customer_state varchar(20) NOT NULL
);

CREATE TABLE Seller(
seller_ID int(10) PRIMARY KEY,
seller_username varchar(50) UNIQUE NOT NULL,
seller_password varchar(50) unique not null,
seller_phone_number varchar(20) UNIQUE NOT NULL,
seller_phone_number2 varchar(20) UNIQUE,
seller_email_id varchar(50) UNIQUE,
seller_city varchar(40) NOT NULL,
seller_state varchar(20) NOT NULL
);

CREATE TABLE Category(
category_ID int(10)PRIMARY KEY,
category_name varchar(50)  NOT NULL
);

CREATE TABLE Product(
product_id int(10) PRIMARY KEY,
product_name varchar(40) NOT NULL,
category_id int(10),
brand_name varchar(50) NOT NULL,
product_price int(6) NOT NULL CHECK(product_price>0),
product_quantity int(3) NOT NULL CHECK(product_quantity>=0),
product_discount int(2) CHECK(product_discount<=80) CHECK(product_discount>=0),
FOREIGN KEY (category_id) REFERENCES Category(category_ID)
);



CREATE TABLE Delivery_Agent(
agent_ID int(10) PRIMARY KEY,
agent_username varchar(30) not null,
agent_password varchar(30) unique not null,
contact_number varchar(10) UNIQUE NOT NULL,
contact_number2 varchar(10) UNIQUE,
agent_email_id varchar(50) UNIQUE,
expected_time_of_delivery varchar(5) NOT NULL
);

CREATE TABLE Order_(
order_ID int(10) PRIMARY KEY,
order_date date NOT NULL,
order_time time NOT NULL,
product_id int(10),
customer_id int(10),
seller_id int(10),
agent_id int(10),
FOREIGN KEY (customer_id) REFERENCES Customer(customer_ID),
FOREIGN KEY (seller_id) REFERENCES Seller(seller_ID),
FOREIGN KEY (agent_id) REFERENCES Delivery_Agent(agent_ID),
FOREIGN KEY (product_ID) REFERENCES Product(product_ID)
);

CREATE TABLE Payment(
payment_ID int(10) PRIMARY KEY,
order_ID int(10) UNIQUE NOT NULL,
payment_date date NOT NULL,
payment_time time NOT NULL,
payment_method varchar(40) NOT NULL CHECK(payment_method = 'Credit Card' OR payment_method = 'Debit Card' OR payment_method = 'Cash on Delivery' OR payment_method = 'NetBanking'),
payment_amount int(6) CHECK(payment_amount>0),
FOREIGN KEY (order_ID) REFERENCES Order_(order_ID)
);

CREATE TABLE Cart(
customer_ID int(10),
product_ID int(10),
quantity int(2) CHECK(quantity>=0) NOT NULL,
FOREIGN KEY (customer_ID) REFERENCES Customer(customer_ID),
FOREIGN KEY (product_ID) REFERENCES Product(product_ID)
);

CREATE TABLE Wishlist(
customer_ID int(10),
product_ID int(10),
product_ID2 int(10),
product_ID3 int(10),
product_ID4 int(10),
product_ID5 int(10),
-- total_cost int(7),
FOREIGN KEY (customer_ID) REFERENCES Customer(customer_ID),
FOREIGN KEY (product_ID) REFERENCES Product(product_ID),
FOREIGN KEY (product_ID2) REFERENCES Product(product_ID),
FOREIGN KEY (product_ID3) REFERENCES Product(product_ID),
FOREIGN KEY (product_ID4) REFERENCES Product(product_ID),
FOREIGN KEY (product_ID5) REFERENCES Product(product_ID)
);

CREATE TABLE Wallet(
customer_ID int(10),
wallet_amount int(7) CHECK(wallet_amount>=0) NOT NULL,
FOREIGN KEY (customer_ID) REFERENCES Customer(customer_ID)
);

CREATE TABLE Feedback(
feedback_ID int(10) PRIMARY KEY,
product_ID int(10),
product_name varchar(40),
brand_name varchar(20),
customer_ID int(10),
customer_name varchar(50),
product_feedback varchar(50) NOT NULL,
feedback_date date NOT NULL,
feedback_time time NOT NULL,
FOREIGN KEY (customer_ID) REFERENCES Customer(customer_ID),
FOREIGN KEY (product_ID) REFERENCES Product(product_ID)
);

CREATE TABLE lists(
category_id int(10),
seller_id int(10),
FOREIGN KEY (category_id) REFERENCES Category(category_id),
FOREIGN KEY (seller_id) REFERENCES Seller(seller_id)
);
 
CREATE TABLE adds(
	agent_id int(10),
    seller_id int(10),
    FOREIGN KEY (agent_id) REFERENCES Delivery_Agent(agent_id),
    FOREIGN kEY (seller_id) REFERENCES Seller(seller_id)
);

