-- OLAP QUERIES
-- (1)Total inventory of a brand
select brand_name, sum(product_quantity) as 'Total Inventory'
from Product
GROUP BY brand_name with rollup;

-- (2)total orders delivered by an agent
select agent_id, count(order_id) as 'total Orders'
from Order_ 
group by agent_id with rollup;

-- third
SELECT Seller.seller_username, SUM(Product.product_price * Product.product_quantity) AS total_revenue, COUNT(Order_.order_ID) AS number_of_orders
FROM Product
INNER JOIN Order_ ON Product.product_id = Order_.product_ID
INNER JOIN Seller ON Order_.seller_ID = Seller.seller_ID
GROUP BY Seller.seller_username;

-- fourth
SELECT Category.category_name, SUM(Product.product_price * Product.product_quantity) AS total_sales
FROM Product
INNER JOIN Category ON Product.category_id = Category.category_ID
INNER JOIN Order_ ON Product.product_id = Order_.product_ID
WHERE Order_.order_date
GROUP BY Category.category_name;

-- Retrieve the total revenue and number of orders for each seller:
SELECT Seller.seller_username, SUM(Product.product_price * Product.product_quantity) AS total_revenue, COUNT(Order_.order_ID) AS number_of_orders
FROM Product
INNER JOIN Order_ ON Product.product_id = Order_.product_ID
INNER JOIN Seller ON Order_.seller_ID = Seller.seller_ID
GROUP BY Seller.seller_username WITH ROLLUP;


-- Retrieves the total sales by Customer: 
SELECT Category.category_name, SUM(Product.product_price * Product.product_quantity) AS total_sales
FROM Product
INNER JOIN Category ON Product.category_id = Category.category_ID
INNER JOIN Order_ ON Product.product_id = Order_.product_ID
WHERE Order_.order_date
GROUP BY Category.category_name WITH ROLLUP;

